              <TableCell>{invoice.taxPercent}</TableCell> */}
              <TableCell>{/* Calculate total price */}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default InvoiceGrid;
